import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import NavButton from "../NavButton";

import "./Footer.scss";

const Footer = props => (
  <div className="NavBar">
    {props.navButtons.map(button => (
      <NavButton
        key={button.path}
        path={button.path}
        label={button.label}
        icon={<FontAwesomeIcon icon={button.icon} />
      }
      />
    ))}
  </div>
);

export default Footer;
